import { AppBar, Box, Drawer, Toolbar, Typography } from '@mui/material'
import NotificationsNoneOutlinedIcon from '@mui/icons-material/NotificationsNoneOutlined';
import SettingsOutlinedIcon from '@mui/icons-material/SettingsOutlined';
import ExitToAppOutlinedIcon from '@mui/icons-material/ExitToAppOutlined';
import React from 'react'
import { blue } from '@mui/material/colors';

const Rubitron = () => {
  return (
    <div>
      <AppBar sx={{bgcolor:'#3f51b5'}}>
        <Toolbar style={{ height: 5 }}>
            <Typography sx={{pl:3 , opacity:0.6 }}>RubiTron Labs</Typography>
            <NotificationsNoneOutlinedIcon fontSize='small' sx={{pl:128, mr:2 , size:'small'}}  />
            <SettingsOutlinedIcon fontSize='small' sx={{ mr:2}}/>
            <ExitToAppOutlinedIcon fontSize='small' sx={{mr:0.5}}/>
            <Typography sx={{fontWeight:'bold' , fontSize:'0.7rem'}}>SIGN OUT</Typography>
        </Toolbar>
      </AppBar>
      <Drawer variant='permanent' sx={{t:10}}>Hello</Drawer>
    </div>
  )
}

export default Rubitron
